const puppeteer = require('puppeteer');

(async () => {
    const browser = await puppeteer.launch({ headless: true });
    const page = await browser.newPage();
    await page.goto('https://gameindriver.ru/');
    await page.evaluate(() => {
        const START = 0;

        function xxx() {
        //#region
        const src =
            'data:image/png;base64,';

        //#endregion

        function getActualData() {
            const canvas = document.getElementById('app_canvas');
            const ctx = canvas.getContext('2d');
            const data = ctx.getImageData(0, 0, canvas.width, canvas.height)
                .data;
            return { actual: data, w1: canvas.width, h1: canvas.height };
        }

        function getPixel(data, width, x, y) {
            let p = (y * width + x) * 4;
            const r = data[p++];
            const g = data[p++];
            const b = data[p++];
            const a = data[p++];

            return { r, g, b, a, x, y };
        }

        // data1 — эталон
        // data2 — факт
        function getFirstDiff(w, h, data1, w1, h1, data2) {
            for (let y = START; y < h; y++) {
                for (let x = 0; x < w; x++) {
                    const p1 = getPixel(data1, w, x, y);
                    const p2 = getPixel(data2, w1, x, y);

                    if (p1.r !== p2.r || p1.g !== p2.g || p1.b !== p2.b) {
                        return p1;
                    }
                }
            }
        }

        var image = new Image(155, 222);
        image.onload = drawImageActualSize;
        image.src = src;

        function shuffleArray(array) {
            for (var i = array.length - 1; i > 0; i--) {
                var j = Math.floor(Math.random() * (i + 1));
                var temp = array[i];
                array[i] = array[j];
                array[j] = temp;
            }
        }

        function drawImageActualSize() {
            const canvas = document.createElement('canvas');
            canvas.width = this.naturalWidth;
            canvas.height = this.naturalHeight;

            const ctx = canvas.getContext('2d');
            ctx.drawImage(this, 0, 0);

            const etalon = ctx.getImageData(0, 0, canvas.width, canvas.height)
                .data;

            setInterval(() => {
                const { w1, h1, actual } = getActualData();
                const diff = getFirstDiff(
                    canvas.width,
                    canvas.height,
                    etalon,
                    w1,
                    h1,
                    actual
                );

                if (diff) {
                    console.log(diff);
                    const { r, g, b, x, y } = diff;
                    painterInput.value = window.rgbaToHex([r, g, b]);
                    app.paint(x, y);
                } else {
                    console.log('no diff');
                }
            }, 2100);
        }
    }

    xxx();
    });
})();
